import React, {useEffect, useState} from 'react';
import ArticleService from "../../services/ArticleService";
import {Image} from "react-bootstrap";
import Eye from "../../eye.svg";

const LikedArticles = () => {

    const [data, setData] = useState([]);
    const fetchData = async () => {
        try {
            setData(await ArticleService.getHeaders());
        } catch (error) {
            console.error('ArticleAPI stopped');
        }
    };

    useEffect(() => {
        fetchData().then();
    }, []);

    return (
        <>
            {data.map(item => (
                <div key={item.id} className="container pb-lg-4" style={{backgroundColor: 'white'}}>
                    <div className="row">
                        <div className="col-xl-2 text-end">
                            <h4>Author</h4>
                        </div>
                        <div className="col-xl-3 text-start mt-xl-2">
                            <h6 style={{color: "gray"}}>Tuesday, 14 November</h6>
                        </div>
                        <div className="offset-xl-7 col-xl-2 mt-xl-3 text-xl-end">
                            <h6 style={{color: "gray"}}>{item.views} <Image src={Eye} style={{width: '35%', marginTop: '-4px'}} alt='Eye'/></h6>
                        </div>
                    </div>
                </div>
            ))}
        </>
    );
};

export default LikedArticles;
